export const styles = {
  appBar: {
    backgroundColor: "#4580bf",
    align: "right",
    height: "60px",
    '& .MuiToolbar-regular': {
      minHeight: "60px"
    }
  },
  name: {
    marginRight: "18px",
    color: "#dbdbdb",
  },
  link: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",

  },
  logo: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",

  },
  rightToolbar: {
    marginLeft: "auto",
    marginRight: -12
  },
}
